import React from "react";
import Item from "./components/item";
import Cart from "./components/cart";

function App() {
  return (
    <div>
      <h1>Gestion du Panier</h1>
      <Item id={1} name="tables" price={200} />
      <Item id={2} name="chaises" price={100} />
      <Cart />
    </div>
  );
}

export default App;
